import React from 'react';
import Header from '../components/Header';

function CommunityPage() {
  return (
    <div className="container">
      <Header title="社区" />
      
      <main className="content">
        <div className="placeholder-page">
          <h2>社区页面</h2>
          <p>此页面正在开发中...</p>
        </div>
      </main>
    </div>
  );
}

export default CommunityPage;
